import { React } from 'react';
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { createDrawerNavigator } from "@react-navigation/drawer";

import Main from './src/screens/Main';
import Login from './src/screens/Login';
import Excercises from './src/screens/Excercises';
import ExcerciseType from './src/screens/ExcerciseType';
import MainDrawer from './src/screens/MainDrawer';

const Stack = createStackNavigator();
const Drawer = createDrawerNavigator();

export default function Navigate() {

    return <NavigationContainer>
        <Stack.Navigator>
            <Stack.Group>
                <Stack.Screen
                    name="MainScreen"
                    component={Main}
                    options={{title: 'Главная'}}
                    />
                <Stack.Screen
                    name="ExcercisesScreen"
                    component={Excercises}
                    options={{title: 'Виды упражнений'}}
                    />
                <Stack.Screen
                    name="ExcerciseTypeScreen"
                    component={ExcerciseType}
                    options={{title: 'Упражнение'}}
                    />
                <Stack.Screen
                    name="LoginScreen"
                    component={Login}
                    options={{title: 'Авторизация'}}
                    />
                {/* <Stack.Screen
                    name="SurveyScreen"
                    component={Survey}
                    options={{title: 'Опрос'}}
                    /> */}
            </Stack.Group>
        </Stack.Navigator>

        <Drawer.Navigator>
            <Drawer.Group>
                <Drawer.Screen
                    name="MainDrawer"
                    component={MainDrawer}
                />
            </Drawer.Group>
        </Drawer.Navigator>
    </NavigationContainer>
}
